import React from "react";
import Header from "../common/Header";

const GradesPage = () => {
  return (
    <>
      <Header pageTitle={"Grades Page"} />
      <div>
        <h1>Grades Page</h1>
        {/* Content for Grades Page */}
      </div>
    </>
  );
};

export default GradesPage;
